.ace_br1 {border-top-left-radius    : 3px;}
.ace_br2 {border-top-right-radius   : 3px;}
.ace_br3 {border-top-left-radius    : 3px; border-top-right-radius:    3px;}
.ace_br4 {border-bottom-right-radius: 3px;}
.ace_br5 {border-top-left-radius    : 3px; border-bottom-right-radius: 3px;}
.ace_br6 {border-top-right-radius   : 3px; border-bottom-right-radius: 3px;}
.ace_br7 {border-top-left-radius    : 3px; border-top-right-radius:    3px; border-bottom-right-radius: 3px;}
.ace_br8 {border-bottom-left-radius : 3px;}
.ace_br9 {border-top-left-radius    : 3px; border-bottom-left-radius:  3px;}
.ace_br10{border-top-right-radius   : 3px; border-bottom-left-radius:  3px;}
.ace_br11{border-top-left-radius    : 3px; border-top-right-radius:    3px; border-bottom-left-radius:  3px;}
.ace_br12{border-bottom-right-radius: 3px; border-bottom-left-radius:  3px;}
.ace_br13{border-top-left-radius    : 3px; border-bottom-right-radius: 3px; border-bottom-left-radius:  3px;}
.ace_br14{border-top-right-radius   : 3px; border-bottom-right-radius: 3px; border-bottom-left-radius:  3px;}
.ace_br15{border-top-left-radius    : 3px; border-top-right-radius:    3px; border-bottom-right-radius: 3px; border-bottom-left-radius: 3px;}


.ace_editor {
    position: relative;
    overflow: hidden;
    padding: 0;
    font: 12px/normal 'Monaco', 'Menlo', 'Ubuntu Mono', 'Consolas', 'Source Code Pro', 'source-code-pro', monospace;
    direction: ltr;
    text-align: left;
    -webkit-tap-highlight-color: rgba(0, 0, 0, 0);
    forced-color-adjust: none;
}

.ace_scroller {
    position: absolute;
    overflow: hidden;
    top: 0;
    bottom: 0;
    background-color: inherit;
    -ms-user-select: none;
    -moz-user-select: none;
    -webkit-user-select: none;
    user-select: none;
    cursor: text;
}

.ace_content {
    position: absolute;
    box-sizing: border-box;
    min-width: 100%;
    contain: style size layout;
    font-variant-ligatures: no-common-ligatures;
}
.ace_invisible {
    font-variant-ligatures: none;
}

.ace_keyboard-focus:focus {
    box-shadow: inset 0 0 0 2px #5E9ED6;
    outline: none;
}

.ace_dragging .ace_scroller:before{
    position: absolute;
    top: 0;
    left: 0;
    right: 0;
    bottom: 0;
    content: '';
    background: rgba(250, 250, 250, 0.01);
    z-index: 1000;
}
.ace_dragging.ace_dark .ace_scroller:before{
    background: rgba(0, 0, 0, 0.01);
}

.ace_gutter {
    position: absolute;
    overflow : hidden;
    width: auto;
    top: 0;
    bottom: 0;
    left: 0;
    cursor: default;
    z-index: 4;
    -ms-user-select: none;
    -moz-user-select: none;
    -webkit-user-select: none;
    user-select: none;
    contain: style size layout;
}

.ace_gutter-active-line {
    position: absolute;
    left: 0;
    right: 0;
}

.ace_scroller.ace_scroll-left:after {
    content: "";
    position: absolute;
    top: 0;
    right: 0;
    bottom: 0;
    left: 0;
    box-shadow: 17px 0 16px -16px rgba(0, 0, 0, 0.4) inset;
    pointer-events: none;
}

.ace_gutter-cell, .ace_gutter-cell_svg-icons {
    position: absolute;
    top: 0;
    left: 0;
    right: 0;
    padding-left: 19px;
    padding-right: 6px;
    background-repeat: no-repeat;
}

.ace_gutter-cell_svg-icons .ace_gutter_annotation {
    margin-left: -14px;
    float: left;
}

.ace_gutter-cell .ace_gutter_annotation {
    margin-left: -19px;
    float: left;

.ace_scrollbar {
    contain: strict;
    position: absolute;
    right: 0;
    bottom: 0;
    z-index: 6;
}

.ace_scrollbar-inner {
    position: absolute;
    cursor: text;
    left: 0;
    top: 0;
}

.ace_scrollbar-v{
    overflow-x: hidden;
    overflow-y: scroll;
    top: 0;
}

.ace_scrollbar-h {
    overflow-x: scroll;
    overflow-y: hidden;
    left: 0;
}

.ace_print-margin {
    position: absolute;
    height: 100%;
}

.ace_text-input {
    position: absolute;
    z-index: 0;
    width: 0.5em;
    height: 1em;
    opacity: 0;
    background: transparent;
    -moz-appearance: none;
    appearance: none;
    border: none;
    resize: none;
    outline: none;
    overflow: hidden;
    font: inherit;
    padding: 0 1px;
    margin: 0 -1px;
    contain: strict;
    -ms-user-select: text;
    -moz-user-select: text;
    -webkit-user-select: text;
    user-select: text;
    /*with \`pre-line\` chrome inserts &nbsp; instead of space*/
    white-space: pre!important;
}
.ace_text-input.ace_composition {
    background: transparent;
    color: inherit;
    z-index: 1000;
    opacity: 1;
}
.ace_composition_placeholder { color: transparent }
.ace_composition_marker { 
    border-bottom: 1px solid;
    position: absolute;
    border-radius: 0;
    margin-top: 1px;
}

[ace_nocontext=true] {

    clip-path: none!important;
    mask : none!important;

}

.ace_layer {
    z-index: 1;
    position: absolute;
    overflow: hidden;
    /* workaround for chrome bug https://github.com/ajaxorg/ace/issues/2312*/
    word-wrap: normal;
    white-space: pre;
    height: 100%;
    width: 100%;
    box-sizing: border-box;
    /* setting pointer-events: auto; on node under the mouse, which changes
        during scroll, will break mouse wheel scrolling in Safari */
    pointer-events: none;
}

.ace_gutter-layer {
    position: relative;
    width: auto;
    text-align: right;
    pointer-events: auto;
    height: 1000000px;
    contain: style size layout;
}

.ace_text-layer {
    font: inherit !important;
    position: absolute;
    height: 1000000px;
    width: 1000000px;
    contain: style size layout;
}

.ace_text-layer > .ace_line, .ace_text-layer > .ace_line_group {

    top: 0;

.ace_cjk {

.ace_cursor-layer {

.ace_cursor {

/* Ace编辑器主主题的行号区域样式 */
.ace-maintheme .ace_gutter {
  background: var(--el-card-bg-color); /* 背景颜色 */
  color: var(--el-text-color-regular); /* 文本颜色 */
  transition: background-color 0.3s ease-in-out; /* 背景颜色过渡效果 */
}

/* Ace编辑器主主题的打印边距样式 */
.ace-maintheme .ace_print-margin {
  width: 1px; /* 宽度 */
  background: var(--el-card-bg-color); /* 背景颜色 */
  transition: background-color 0.3s ease-in-out; /* 背景颜色过渡效果 */
}

/* Ace编辑器主主题的整体样式 */
.ace-maintheme {
  background-color: var(--el-card-bg-color); /* 背景颜色 */
  color: var(--el-text-color-primary); /* 文本颜色 */
  transition: background-color 0.3s ease-in-out; /* 背景颜色过渡效果 */
}

/* Ace编辑器主主题的光标样式 */
.ace-maintheme .ace_cursor {
  color: var(--el-color-primary); /* 光标颜色 */
  transition: background-color 0.3s ease-in-out; /* 背景颜色过渡效果 */
}

/* Ace编辑器主主题中标记层选区的样式 */
.ace-maintheme .ace_marker-layer .ace_selection {
  background: var(--el-border-color); /* 选区背景颜色 */
  transition: background-color 0.3s ease-in-out; /* 背景颜色过渡效果 */
}

/* Ace编辑器主主题中标记层括号匹配高亮样式 */
.ace-maintheme .ace_marker-layer .ace_bracket {
  margin: -1px 0 0 -1px; /* 外边距 */
  border: 1px solid var(--el-border-color); /* 边框样式 */
  transition: background-color 0.3s ease-in-out; /* 背景颜色过渡效果 */
}

/* Ace编辑器主主题中标记层活动行的样式 */
.ace-maintheme .ace_marker-layer .ace_active-line {
  background: var(--el-card-bg-color); /* 活动行背景颜色 */
  transition: background-color 0.3s ease-in-out; /* 背景颜色过渡效果 */
}

/* Ace编辑器主主题行号区域中活动行的样式 */
.ace-maintheme .ace_gutter-active-line {
  background-color: var(--el-bg-color); /* 活动行号背景颜色 */
  transition: background-color 0.3s ease-in-out; /* 背景颜色过渡效果 */
}

/* Ace编辑器主主题中标记层被选中单词的样式 */
.ace-maintheme .ace_marker-layer .ace_selected-word {
  border: 1px solid var(--el-border-color); /* 选中单词边框 */
  transition: background-color 0.3s ease-in-out; /* 背景颜色过渡效果 */
}

/* Ace编辑器主主题中不可见字符（如空格、Tab）的样式 */
.ace-maintheme .ace_invisible {
  color: var(--el-text-color-regular); /* 不可见字符颜色 */
  transition: background-color 0.3s ease-in-out; /* 背景颜色过渡效果 */
}

/* Ace编辑器主主题中标签实体、关键字、元标签和存储修饰符的颜色 */
.ace-maintheme .ace_entity.ace_name.ace_tag,
.ace-maintheme .ace_keyword,
.ace-maintheme .ace_meta.ace_tag,
.ace-maintheme .ace_storage {
  color: var(--el-color-primary); /* 颜色 */
  transition: background-color 0.3s ease-in-out; /* 背景颜色过渡效果 */
}

/* Ace编辑器主主题中标点符号和标签标点符号的颜色 */
.ace-maintheme .ace_punctuation,
.ace-maintheme .ace_punctuation.ace_tag {
  color: var(--el-color-primary);  /* 颜色 */
  transition: background-color 0.3s ease-in-out; /* 背景颜色过渡效果 */
}

/* Ace编辑器主主题中字符常量、语言常量、数字常量和其他常量的颜色 */
.ace-maintheme .ace_constant.ace_character,
.ace-maintheme .ace_constant.ace_language,
.ace-maintheme .ace_constant.ace_numeric,
.ace-maintheme .ace_constant.ace_other {
  color: var(--el-color-success); /* 颜色 */
  transition: background-color 0.3s ease-in-out; /* 背景颜色过渡效果 */
}

/* Ace编辑器主主题中无效代码的样式 */
.ace-maintheme .ace_invalid {
  color: var(--el-text-color-primary); /* 文本颜色 */
  background-color: var(--el-color-danger); /* 背景颜色 */
  transition: background-color 0.3s ease-in-out; /* 背景颜色过渡效果 */
}

/* Ace编辑器主主题中已废弃的无效代码的样式 */
.ace-maintheme .ace_invalid.ace_deprecated {
  color: var(--el-text-color-primary); /* 文本颜色 */
  background-color: var(--el-color-danger); /* 背景颜色 */
  transition: background-color 0.3s ease-in-out; /* 背景颜色过渡效果 */
}

/* Ace编辑器主主题中支持库常量和函数的颜色 */
.ace-maintheme .ace_support.ace_constant,
.ace-maintheme .ace_support.ace_function {
  color: var(--el-color-warning); /* 颜色 */
  transition: background-color 0.3s ease-in-out; /* 背景颜色过渡效果 */
}

/* Ace编辑器主主题中代码折叠区域的样式 */
.ace-maintheme .ace_fold {
  background-color: #A6E22E; /* 背景颜色 */
  border-color: #F8F8F2; /* 边框颜色 */
  transition: background-color 0.3s ease-in-out; /* 背景颜色过渡效果 */
}

/* Ace编辑器主主题中存储类型、支持库类和支持库类型的样式 */
.ace-maintheme .ace_storage.ace_type,
.ace-maintheme .ace_support.ace_class,
.ace-maintheme .ace_support.ace_type {
  font-style: italic; /* 字体样式：斜体 */
  color: var(--el-color-success); /* 颜色 */
  transition: background-color 0.3s ease-in-out; /* 背景颜色过渡效果 */
}

/* Ace编辑器主主题中函数名、其他实体、属性名和变量的颜色 */
.ace-maintheme .ace_entity.ace_name.ace_function,
.ace-maintheme .ace_entity.ace_other,
.ace-maintheme .ace_entity.ace_other.ace_attribute-name,
.ace-maintheme .ace_variable {
  color: var(--el-color-primary); /* 颜色 */
  transition: background-color 0.3s ease-in-out; /* 背景颜色过渡效果 */
}

/* Ace编辑器主主题中函数参数的样式 */
.ace-maintheme .ace_variable.ace_parameter {
  font-style: italic; /* 字体样式：斜体 */
  color: var(--el-color-info); /* 颜色 */
  transition: background-color 0.3s ease-in-out; /* 背景颜色过渡效果 */
}

/* Ace编辑器主主题中字符串的颜色 */
.ace-maintheme .ace_string {
  color: var(--el-color-warning); /* 颜色 */
  transition: background-color 0.3s ease-in-out; /* 背景颜色过渡效果 */
}

/* Ace编辑器主主题中注释的颜色 */
.ace-maintheme .ace_comment {
  color: var(--el-color-success); /* 颜色 */
  transition: background-color 0.3s ease-in-out; /* 背景颜色过渡效果 */
}

/* Ace编辑器主主题中缩进指南线的样式 */
.ace-maintheme .ace_indent-guide {
  background: url(data:image/png;base64,iVBORw0KGgoAAAANSUhEUgAAAAEAAAACCAYAAACZgbYnAAAAEklEQVQImWPQ0FD0ZXBzd/wPAAjVAoxeSgNeAAAAAElFTkSuQmCC) right repeat-y /* 背景图片 */
}

/* Ace编辑器主主题中活动缩进指南线的样式 */
.ace-maintheme .ace_indent-guide-active {
  background: url(data:image/png;base64,iVBORw0KGgoAAAANSUhEUgAAAAEAAAACCAYAAACZgbYnAAAAEklEQVQIW2PQ1dX9zzBz5sz/ABCcBFFentLlAAAAAElFTkSuQmCC) right repeat-y; /* 背景图片 */
}

.ace-maintheme .ace_autocomplete {
  background: var(--el-bg-color); /* 活动行背景颜色 */
  border: 1px solid var(--el-border-color); /* 活动行边框 */
  border-radius: 4px; /* 活动行边框圆角 */

.ace_editor.ace_autocomplete .ace_marker-layer .ace_active-line {
    background-color: #CAD6FA;
    z-index: 1;
}
.ace_dark.ace_editor.ace_autocomplete .ace_marker-layer .ace_active-line {
    background-color: #3a674e;
}
.ace_editor.ace_autocomplete .ace_line-hover {
    border: 1px solid #abbffe;
    margin-top: -1px;
    background: rgba(233,233,253,0.4);
    position: absolute;
    z-index: 2;
}
.ace_dark.ace_editor.ace_autocomplete .ace_line-hover {
    border: 1px solid rgba(109, 150, 13, 0.8);
    background: rgba(58, 103, 78, 0.62);
}
.ace_completion-meta {
    opacity: 0.5;
    margin-left: 0.9em;
}
.ace_completion-message {
    margin-left: 0.9em;
    color: blue;
}
.ace_editor.ace_autocomplete .ace_completion-highlight{
    color: #2d69c7;
}
.ace_dark.ace_editor.ace_autocomplete .ace_completion-highlight{
    color: #93ca12;
}
.ace_editor.ace_autocomplete {
    width: 300px;
    z-index: 200000;
    border: 1px lightgray solid;
    position: fixed;
    box-shadow: 2px 3px 5px rgba(0,0,0,.2);
    line-height: 1.4;
    background: #fefefe;
    color: #111;
}
.ace_dark.ace_editor.ace_autocomplete {
    border: 1px #484747 solid;
    box-shadow: 2px 3px 5px rgba(0, 0, 0, 0.51);
    line-height: 1.4;
    background: #25282c;
    color: #c1c1c1;
}
.ace_autocomplete .ace_text-layer  {
    width: calc(100% - 8px);
}
.ace_autocomplete .ace_line {
    display: flex;
    align-items: center;
}
.ace_autocomplete .ace_line > * {
    min-width: 0;
    flex: 0 0 auto;
}
.ace_autocomplete .ace_line .ace_ {
    flex: 0 1 auto;
    overflow: hidden;
    text-overflow: ellipsis;
}
.ace_autocomplete .ace_completion-spacer {
    flex: 1;
}
.ace_autocomplete.ace_loading:after  {
    content: "";
    position: absolute;
    top: 0px;
    height: 2px;
    width: 8%;
    background: blue;
    z-index: 100;
    animation: ace_progress 3s infinite linear;
    animation-delay: 300ms;
    transform: translateX(-100%) scaleX(1);
}
@keyframes ace_progress {
    0% { transform: translateX(-100%) scaleX(1) }
    50% { transform: translateX(625%) scaleX(2) } 
    100% { transform: translateX(1500%) scaleX(3) } 
}
@media (prefers-reduced-motion) {
    .ace_autocomplete.ace_loading:after {
        transform: translateX(625%) scaleX(2);
        animation: none;
     }
}
